/** @format */

import styled from "styled-components";

function Header() {
  return (
    <HeaderWrapper>
      <a>
        <img src="./images/logo.svg" alt="Tesla Logo"></img>
      </a>
      <Menu>
        <ul>
          <li>Model S</li>
          <li>Model 3</li>
          <li>Model X</li>
          <li>Model Y</li>
          <li>Solar Roof</li>
          <li>Solar Panels</li>
        </ul>
      </Menu>
    </HeaderWrapper>
  );
}

export default Header;

const HeaderWrapper = styled.div`
  min-height: 60px;
  position: fixed; //sticky header
  display: flex;
  align-items: center;
  // flex-direction: column;
  justify-content: space-between;
  padding: 0 20px;
`;

const Menu = styled.div`
  display: flex;
  color: red;
  margin: 000 2rem;
`;
